import axios from "axios";
import { useState, useEffect } from "react";

const IndiaCluster = () => {
    const [myData, setMyData] = useState([])
    const [myCluster, setClusters] = useState([])

    useEffect(() => {
        axios.get('./india-cluster.json')
          .then((res) => setMyData(res.data)
        )
    }, []);

    if(myData.length > 0){
        console.log(myData)
        setClusters(myData)
    }

    return (  
      <div className="cluster">
        {
          myData.map((post) => {
            let { labels } = post
          })
        }
        </div>
    )
}

export default IndiaCluster

